import React from 'react';

import Search from '../Search/Search';






class Container extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            results: ""
        }
        this.handleResult = this.handleResult.bind(this);
    }
    handleResult(event){
        this.setState({
            results: event
        })
    }


    render(){
        return(
            <div> 
                <Search setResults={this.handleResult}/>

            </div>
        )
    }

}



export default Container;
